INSERT INTO `ps_category_lang` VALUES (1,1,1,'Baza','','baza','','',''),(2,1,1,'Strona główna','','strona-glowna','','',''),(14,1,1,'LAMPY PODŁOGOWE','Lampy stojące nowoczesne to oświetlenie kinkiety wykonywane z modnych materiałów, często metali, papieru czy tworzyw sztucznych. Tego typu podłogowe lampy nowoczesne wyróżniają się oryginalną stylistyką, nietypowymi kształtami, kolorami czy formami. Część dostępnych w naszym sklepie lamp stojących podłogowych może stanowić samodzielną dekorację i uzupełnienie stylizacji wnętrza.','lampy-podlogowe','','',''),(15,1,1,'LAMPY SUFITOWE','Lampy sufitowe są niezwykle uniwersalnym oświetleniem pasującym do wszystkich rodzajów pomieszczeń. Ze względu na dużą popularność oświetlenia sufitowego powstało mnóstwo nowych modeli, dzięki czemu idealne lampy do swoich wnętrz znajdą nawet Ci najbardziej wymagający.','lampy-sufitowe','','',''),(16,1,1,'KINKIETY','Kinkiety wewnętrzne to wciąż niezastąpione oświetlenie, które zaskakuje funkcjonalnością. Ogromna oferta lamp ściennych pozwala na wybranie kinkietu idealnie komponującego się ze stylem wnętrz. W naszym asortymencie znajdziesz: kinkiety industrialne dla stylowych loftów, kinkiety biurowe dla wydajnej i zdrowej pracy, kinkiety świecznikowe dla wytwornych wnętrz w stylu retro oraz wiele innych modeli.','kinkety','','',''),(17,1,1,'LAMPY Z ABAŻURAMI','Lampy z abażurami to wspaniała ozdoba dla każdego rodzaju wnętrz. Gustowny abażur może nadać pomieszczeniu zupełnie nowego klimatu. Rodzajów lamp abażurowych jest całe mnóstwo, dlatego warto dokładnie zapoznać się z ofertą przed wyborem oświetlenia. Abażury w paski, geometryczne wzory czy w kwiaty – z lampami z abażurami PCV przystroisz każde pomieszczenie.','lampy-z-abazurami','','',''),(18,1,1,'AKCESORIA DO LAMP','W ofercie sklepu znajdziesz nie tylko oświetlenie i żarówki, ale również akcesoria do lamp. Wśród nich dostępne są klosze do lamp metalowe lub szklane.','akcesoria-do-lamp','','',''),(19,1,1,'ŹRÓDŁA ŚWIATŁA','Wybierając żarówkę do lampy, musimy wziąć pod uwagę różne czynniki – jaką barwę ma mieć światło w pokoju, jak intensywnie mają świecić żarówki, ledy czy halogeny. Posiadamy mnóstwo rodzajów żarówek w naszej ofercie, dzięki czemu z pewnością znajdziesz interesujący Cię model. Jeśli jeszcze nie wiesz, na jakie źródła światła się zdecydować, pomożemy Ci dokonać wyboru.','zrodla-swiatla','','','');
/*!40000 ALTER TABLE `ps_category_lang` ENABLE KEYS */;
UNLOCK TABLES;

