INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','','warunki dostawy','dostawa, opóźnienia','<h2>Dostawa i zwroty</h2>\n<h3>Dostawa twojego zamówienia</h3>\n<p>Paczki są zwykle wysyłane w ciągu 2 dni po zaksięgowaniu płatności i są wysyłane UPSem z namierzaniem i dostawą bez podpisu. Jeżeli preferujesz dostawę UPS Extra z wymaganyym podpisem, zostanie naliczony dodatkowy koszt, więc prosimy o kontakt przed wybraniem tej metody.. Opłata za przesyłakę zawiera opłatę za pakowanie i obsługę przesyłki. Opłaty za obsługę są stałę, jednak opłata za transport różni się w zależności od wagi przesyłki. Doradzamy grupowanie zamówień w przypadku zamawiania więcej niż jednego produktu w zamówieniu. Opakowania są zabezpieczone i dostosowane do wymiarów zamówienia.</p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','prawo','<h3>Uznanie/zasługi</h3>\n<p>produkcja:</p>\n<p>Ta strona została stworzona z wykorzysaniem oprogamowania open-source <a href=\"http://www.prestashop.com\">PrestaShop</a>™  .</p>','nota-prawna'),(3,1,1,'Warunki użytkowania','','Nasze warunki użytkowania','warunki, użycie','<h2>Nasze warunki użytkowania</h2>\n<h3>warunek 1 </h3>\n<p>tresc warunku 1</p>\n<h3>warunek 2</h3>\n<p>tresc warunku 2</p>\n<h3>warunek 3 </h3>\n<p>tresc warunku 3</p>','warunki-uzytkowania'),(4,1,1,'O nas','','Dowiedz się więcej o nas','o nas, informacje, my','<h2>o nas</h2>\n<h3>nasza firma</h3>\n<p>grupa studentów</p>\n<h3>nasza ekipa</h3>\n<p>studenci</p>\n<h3>informacje</h3>\n<p>studenci pg</p>','o-nas'),(5,1,1,'Bezpieczna płatność','','Nasze środki zabezpieczania płatności','ssl, visa, mastercard, paypal, płatność','<h2>Bezpieczna płatność</h2>\n<h3>nasze bezpieczne płatności</h3>\n<p>używając SSL</p>\n<h3>używając Visa/Mastercard/Paypal</h3>\n<p>info o serwisie dokonywania płatności</p>','bezpieczna-platnosc');
